import React, { useEffect, useState } from "react";
import { eventAPI } from "..services/api";

const Dashboard = () => {
  const [conversations, setConversations] = useState([]);
  const [journey, setJourney] = useState(null);

  useEffect(() => {
    eventAPI.getConversations().then(res => {
      setConversations(res.data || []);
    });

    eventAPI.getJourney().then(res => {
      setJourney(res.data || null);
    });
  }, []);

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">Dashboard</h1>

      {/* Conversations */}
      <div className="mb-8">
        <h2 className="text-xl font-semibold mb-2">Conversations</h2>
        {Array.isArray(conversations) ? (
          <ul className="list-disc list-inside">
            {conversations.map((conv, idx) => (
              <li key={idx}>
                <strong>{conv.sender}</strong>: {conv.message}
              </li>
            ))}
          </ul>
        ) : (
          <p>No conversations available.</p>
        )}
      </div>

      {/* Journey */}
      <div>
        <h2 className="text-xl font-semibold mb-2">Journey</h2>
        {journey && Array.isArray(journey.journey) ? (
          journey.journey.map((ep, idx) => (
            <div key={idx} className="mb-4 border-b pb-2">
              <h3 className="font-bold">
                Month {ep.month}: {ep.episode}
              </h3>
              <p className="text-gray-600">
                {ep.metrics.messages} messages, {ep.metrics.decisions} decisions
              </p>
            </div>
          ))
        ) : (
          <p>No journey data available.</p>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
